// import "./Curriculums_visualization.css"

import {ourCurriculumEmpty, disciplinesOurCurriculumEmpty} from "../common/common_values";

import Curriculums_visualization_static_information from "./parts/Curriculums_visualization_static_information";

import UGVA_man from "../../common/UGVA-man/UGVA-man";

import choiseNeedColor from "../common/common_values/choiseNeedColor";


const Curriculums_visualization = (props) => {

    const {valuesGroupsSkills, id, curriculums, disciplines, skills, estimates,
            proportionsUGVA, colorsUGVA, max} = props;


    let tableValuesGroupsSkills = valuesGroupsSkills.map(el => {
        const estimate = Math.ceil((el.estimate)*100)/100;

        const color = choiseNeedColor(el.fragment);

        return (
            <tr>
                <td>{el.name}</td>
                <td>{estimate}</td>
                <td>{el.fragment}</td>
                <td>{colorsUGVA[color]}</td>
            </tr>
        )
    })



    return (
        <div className="app_content_visualization visualization_container">
            <div className="visualization_content_left">
                <Curriculums_visualization_static_information valuesGroupsSkills={valuesGroupsSkills}
                                                id={id} curriculums={curriculums} disciplines={disciplines}
                                                skills={skills} estimates={estimates} />
                <div>
                    Отредактировать "улыбку"
                </div>
                <div>
                    Показать нулевые элементы
                </div>

                <div>
                    <table>
                        <thead>
                            <tr>
                                <th>Group skills</th>
                                <th>Estimate</th>
                                <th>Fragment</th>
                                <th>Color</th>
                            </tr>
                        </thead>
                        <tbody>
                            {tableValuesGroupsSkills}
                        </tbody>
                    </table>
                </div>

                <div>
                    Таблица редактирования
                </div>
            </div>
            <div className='visualization_content_right'>
                <UGVA_man proportionsUGVA={proportionsUGVA} colorsUGVA={colorsUGVA}
                                max={max}
                />
            </div>

        </div>
    )
}

export default Curriculums_visualization;
